Por volta das 07h50min, a composição da CP 2375 (FTA) juntamente com o FISCAL DE POLICIAMENTO e a composição da FTA MOTOS se deslocaram até a Vila São Francisco para averiguar denuncia de Tráfico de Drogas e pessoas armadas, que tal denúncia foi confirmada e que 03 acusados foram encontrados na casa com o seguinte material apreendido: 
01 REVOVER TAURUS, calibre 38, capacidade para 06 cartuchos com 
05 munições intactas, cabo de madeira, numeração 8869106; 
10 PAPELOTES DE COCAINA, 1,8g; 
02 PAPELOTES DE MACONHA, 5,7 g; 115,00R$ REAIS EM DINHEIRO; 
01 CELULAR SANSUNG DUOS PRETO; 
01 ESPINGARDA TIPO SOCADEIRA. 

Foram apreendidos os seguintes acusados, todos menores de idade , com esse material: T C P , natural de Crato-CE, nascido em 11.03.2000, solteiro, P H G D S , natural de Crato-CE, nascido em 19.01.2000, solteiro e P H S D S , natural de Crato-CE, nascido em 31.07.2003, solteiro. Todos foram conduzidos a 19ª Delegacia de Polícia Civil de Crato e apresentado ao Delegado Plantonista para os procedimentos cabíveis
